<template>
  <view class="background scroll-container">
    <navbar :isHome="false" background='' />
    <view class="top_height"></view>

    <image style="position: absolute; width: 35vw; height: 25vh; left: 65vw; top: 0vh;"
      src="data:image/svg+xml;base64,">
    </image>

    <!-- 进入界面时 还未产生问答内容 显示默认信息以及问答提示 -->
    <view style="display: flex;">
      <image
        src="data:image/svg+xml;base64,"
        style="width: 23vw; height: 16vh"></image>
      <view class="Sent_information backdrop your-element"
        style="height: 5.5vh; width: 80vw; margin-top: 5vh; padding: 2vh;">
        <text>您好，我是人工智能滴答。</text>
        <br />
        <text>请问您的孩子几岁呢？性别是？</text>
      </view>
    </view>

    <view class="Sent_information backdrop widthAuto your-element" v-if="messageData.length <= 0">
      <view class="nav_content problem_top">
        <text>您可以选择以下常用性教育主题提问。也可以直接问我。</text>
      </view>
      <view class="Default_problem" v-for="(item, index) in problemData" :key="index" @click="selectText(item)">
        {{ item }}
      </view>
    </view>

    <!-- 用户和AI对话区域 上下分别为用户提问 AI回复 -->
    <block v-for="(item, index) in messageData" :key="index">
      <view class="user_backdrop" v-if="item.role == 'user'">
        <view user-select>{{ item.content }}</view>
      </view>

      <view class="Sent_information backdrop" v-else>
        <view class="loading" v-if="item.loadShow">
          <view class="loader"></view>
          <view>AI正在思考中</view>
        </view>
        <view class="ai_content" v-if="item.content != ''">
          <text>{{ item.content }}</text>
          <image v-if="item.copyIcon" @click="copyData(item.content)" src="../../static/copy.png" mode="widthFix">
          </image>
        </view>
      </view>
    </block>

    <!-- 占位 -->
    <view style="height: 100rpx;"></view>

    <!-- 底部输入框 固定定位 -->
    <view class="Input_field">
      <!-- 
      <view>
        <image src="../../static/清除.png" mode="aspectFit" @click="clearMessage"></image>
      </view>
      -->
      <input @confirm="sendMessage" placeholder="我想问滴答AI..." maxlength="-1" cursor-spacing="40" confirm-type="发送"
        auto-blur v-model="text" :disabled="sendIngState"
        style="background-color: #ebebeb; border-radius: 50rpx; width: 63vw; margin-left: 5vw;">
      <view>
        <image src="/static/发送.png" @click="sendMessage"
          style="position: absolute; width: 12vw; height: 6vh; left: 73vw; top: 0.5vh; border-radius: 50rpx;">
        </image>
        <image @click="sendMessage"
          style="position: absolute; width: 12vw; height: 6vh; left: 86vw; top: 0.5vh; border-radius: 50rpx;"
          src="data:image/svg+xml;base64,">
        </image>
      </view>
    </view>

    <view style=" height: 300rpx;">
    </view>
  </view>
</template>

<script setup>
  import {
    ref,
  } from 'vue'
  import MenuButton from '../../common/js/menuButton.js'
  // 进入页面的默认提示
  const problemData = ref([
    '孩子的生殖健康',
    '性与性行为教育',
    '权利和价值观'
  ])
  // 用户输入的问题
  const text = ref('')
  // 存储Socket挂载的方法
  const SocketTask = ref(null)
  // 存储历史对话信息数组 一并发送
  const historyTestList = ref([])
  // 存储AI返回的文本
  const sparkResult = ref('')
  // 临时存储用户的AI对话
  const messageData = ref([])
  // 发送状态 判断ai是否在回复中 false为未开始，回复完毕，出现错误 true为正在进行中，阻止用户行为
  const sendIngState = ref(false)
  // 开始发送消息
  async function sendMessage() {
    if (text.value.trim().length > 0) {
      text.value = text.value.trim()
    } else {
      wx.showToast({
        title: '请输入询问内容',
        icon: 'none'
      })
      return false
    }
    if (sendIngState.value) {
      wx.showToast({
        title: '等待AI回复完毕',
        icon: 'none'
      })
      return false
    }

    messageData.value.push({
      "role": 'user',
      "content": text.value
    })
    messageData.value.push({
      "role": 'assistant',
      "content": '',
      "loadShow": true, // 开始发送时，展示加载
      "copyIcon": false, // 开始发送时，不显示复制按钮
    })
    sparkResult.value = ''
    sendIngState.value = true // 禁用操作

    // 请求云函数 连接
    const wssUrl = await wx.cloud.callFunction({
      name: 'gpt-wx'
    })
    console.log(wssUrl.result.url);

    SocketTask.value = uni.connectSocket({
      url: wssUrl.result.url,
      success: res => {
        console.log(res, 'ws连接成功')
      },
      fail: err => {
        console.log(err, 'ws连接失败')
        wx.showToast({
          title: 'ws连接失败',
          icon: 'none'
        })
        messageData.value = []
        sendIngState.value = false
      }
    })

    // 连接失败的监听
    SocketTask.value.onError((res) => {
      console.log('监听到错误', res.errMsg)
      wx.showToast({
        title: '监听到错误:' + res.errMsg,
        icon: 'none'
      })
      messageData.value = []
      sendIngState.value = false
    })
    // 连接打开事件的监听函数
    SocketTask.value.onOpen(data => {
      console.log('连接成功，接下来可以发送消息了', data)
      // 将用户提问加入历史记录中
      historyTestList.value.push({
        "role": "user",
        "content": text.value
      })
      text.value = '' // 情况对话框 方便下次输入
      // 需要传的值 （参数）
      // 流式对答 将之前的所有用户问答信息 全部传入 （时序信息）
      let params = {
        "header": {
          "app_id": wssUrl.result.APPID,
          "uid": "12345"
        },
        "parameter": {
          "chat": {
            "domain": "generalv3.5",
            "temperature": 1,
            "max_tokens": 2048,
          }
        },
        "payload": {
          "message": {
            "text": historyTestList.value
          }
        }
      }
      // 调用接口send 传入问答对象 （字符串类型）
      SocketTask.value.send({
        data: JSON.stringify(params),
        success: res => {
          console.log('发送消息成功')
        },
        fail: err => {
          console.log('发送消息失败')
          wx.showToast({
            title: '发送消息失败',
            icon: 'none'
          })
          messageData.value = []
          sendIngState.value = false
        }
      })
    })

    // 调用接受消息的接口
    returnMessage()
  }

  function returnMessage() {
    SocketTask.value.onMessage(res => {
      // 得到结果后 将加载信息删除
      messageData.value[messageData.value.length - 1].loadShow = false
      const obj = JSON.parse(res.data)
      console.log(obj)
      // 出现错误
      if (obj.header.code !== 0) {
        sparkResult.value += obj.header.message.replace(/↵/g, '\n')
        messageData.value[messageData.value.length - 1].content = sparkResult.value
        sendIngState = false
        messageData.value[messageData.value.length - 1].copyIcon = true
        return false
      }
      const dataArray = obj.payload.choices.text
      dataArray.forEach(item => {
        // 将返回的↵ 通过正则表达式转换为换行符
        sparkResult.value += item.content.replace(/↵/g, '\n')
        messageData.value[messageData.value.length - 1].content = sparkResult.value
      })

      // ai全部回复完毕的处理
      if (obj.header.code === 0 && obj.header.status === 2) {
        // 将AI回复加入历史记录中
        historyTestList.value.push({
          "role": "assistant",
          "content": sparkResult.value
        })

        // 打开复制按钮
        messageData.value[messageData.value.length - 1].copyIcon = true
        // 还原输入框可操作性
        sendIngState.value = false
      }
    })
  }

  // 复制内容
  function copyData(val) {
    wx.setClipboardData({
      data: val
    })
  }

  // 清屏
  function clearMessage() {
    if (sendIngState.value) {
      wx.showToast({
        title: '等待AI回复完毕',
        icon: 'none'
      })
    }
    sparkResult.value = ''
    historyTestList.value = []
    messageData.value = []
  }

  // 选择默认的发送
  function selectText(val) {
    text.value = val
    sendMessage()
  }
</script>

